import React from "react";
import IITILOGO from "./images/iitilogo.png";
export default function Left() {
  return (
    <>
      <div className="left d-flex">
        <div className="firstleft d-flex" style={{ flexDirection: "column",border:"1px solid black",height:"100vh",width:"3rem",backgroundColor:"#f8f9fa"}}>
          <a href="#"><i class="fa-solid fa-qrcode"style={{padding:"1rem",textDecoration:"none"}}></i></a>
           <a href="#"><i class="fa-regular fa-user"style={{padding:"1rem",textDecoration:"none"}}></i></a>
           <a href="#"><i class="fa-regular fa-user"style={{padding:"1rem",textDecoration:"none"}}></i></a>
           <a href="#"><i class="fa-solid fa-table-cells"style={{padding:"1rem",textDecoration:"none"}}></i></a>
        </div>
        <div className="secondleft">
          
          <div className="logo">
            <img src={IITILOGO } alt="logo" style={{width:"5rem"}}/>
          </div> "
        </div>
      </div>
    </>
  );
}
